async () => {

		if(selectEntityCertIncorp.files.length === 1) {
			await JSObjectKYCIndLLP.deleteIfFileExist('COI');	
			await	QueryInsertEntityKYCIndLLP.run({ 
				docType: 'CertificateOfIncorporation', 
				docPathFilename: selectEntityCertIncorp.files[0].name
			});
			QueryEntityCertIncorp.run();
		}

		if(selectEntityPartnershipDeed.files.length === 1) {
			await JSObjectKYCIndLLP.deleteIfFileExist('PD');	
			await	QueryInsertEntityKYCIndLLP.run({
				docType: 'Partnership Deed', 
				docPathFilename: selectEntityPartnershipDeed.files[0].name
			});
			QueryEntityPartnershipDeed.run();
		}

		if(selectEntityPAN.files.length === 1) {
			await JSObjectKYCIndLLP.deleteIfFileExist('PAN');
			await QueryInsertEntityKYCIndLLP.run({
				docType: 'PAN',
				docPathFilename: selectEntityPAN.files[0].name
			});
			QueryEntityPAN.run();
		}

		if(selectEntityPOA.files.length === 1) {
			await JSObjectKYCIndLLP.deleteIfFileExist('POA');
			await QueryInsertEntityKYCIndLLP.run({ 
				docType: SelectEntityPOADocName.selectedOptionValue,
				docPathFilename: selectEntityPOA.files[0].name
			});
			QuerySelectPOA.run();
		}

		if(selectEntityPartnersList.files.length === 1) {
			await JSObjectKYCIndLLP.deleteIfFileExist('LPDPIN');
			await QueryInsertEntityKYCIndLLP.run({ 
				docType: 'PartnersList',
				docPathFilename: selectEntityPartnersList.files[0].name
			});
			QuerySelectEntityPartnersList.run();
		}

		if(selectEntityCancelledChq.files.length === 1) {
			await JSObjectKYCIndLLP.deleteIfFileExist('CC');
			await QueryInsertEntityKYCIndLLP.run({ 
				docType: 'Cancelled Cheque',
				docPathFilename: selectEntityCancelledChq.files[0].name
			});
			QuerySelectEntityCnclChq.run();
		}

		if(selectEntityCertImpExp.files.length === 1) {
			await JSObjectKYCIndLLP.deleteIfFileExist('IEC');
			await QueryInsertEntityKYCIndLLP.run({ 
				docType: 'Import Export Certificate',
				docPathFilename: selectEntityCertImpExp.files[0].name
			});
			QuerySelectEntityImpExpCert.run();
		}

		if(selectEntityLLPResolution.files.length === 1) {
			await JSObjectKYCIndLLP.deleteIfFileExist('LLPBR');
			await QueryInsertEntityKYCIndLLP.run({ 
				docType: 'LLP Board Resolution',
				docPathFilename: selectEntityLLPResolution.files[0].name
			});
			QuerySelectEntityLLPResolution.run();
		}

		if(selectEntityBenOwnershipDec.files.length === 1) {
			await JSObjectKYCIndLLP.deleteIfFileExist('BOD');
			await QueryInsertEntityKYCIndLLP.run({ 
				docType:'Ownership Declaration',
				docPathFilename: selectEntityBenOwnershipDec.files[0].name
			});
			QueryselectEntityBenOwnershipD.run();
		}

		if(selectEntityPartnershipLetter.files.length === 1) {
			await JSObjectKYCIndLLP.deleteIfFileExist('PL');
			await QueryInsertEntityKYCIndLLP.run({ 
				docType: 'Partnership Letter',
				docPathFilename: selectEntityPartnershipLetter.files[0].name
			});
			QuerySelectEntityPtnrshpLetter.run();
		}

		showAlert('KYC Documents Uploaded');
		navigateTo('Individual KYC Summary', {});
	}

